import React from "react";
import { Body, Container, Header, Title } from "../styled/Home";

export default function HomePage() {
  return (
    <Container>
      <Header>
        <Title>CRUD</Title>
      </Header>
      <Body>
        <div>
          <div>
            <img src="http://placehold.it/" />
            <h1>Title</h1>
            <h2>Description</h2>
            <div>
              <h3>body</h3>
            </div>
          </div>
        </div>
      </Body>
    </Container>
  );
}
